import Layout from "../component/Layout";
import Head from 'next/head'


function HomePage() {
    return (
        <Layout>
            <Head>
                <title>Techronx IT Solution and Services</title>
            </Head>
            <div>Index</div>
        </Layout>
    )
  }
  
export default HomePage
